import React from "react";

const logos = [
  "https://upload.wikimedia.org/wikipedia/commons/6/67/Nestle_textlogo.svg",
  "https://upload.wikimedia.org/wikipedia/commons/f/fa/Apple_logo_black.svg",
  "https://upload.wikimedia.org/wikipedia/commons/a/a9/Amazon_logo.svg"
];

const Logosbar = () => {
  return (
    <div className="flex justify-center items-center py-10 bg-gray-100">
      <div className="grid grid-cols-3 gap-8 max-w-4xl w-full px-4 sm:grid-cols-3 md:grid-cols-3 lg:grid-cols-3">
        {logos.map((logo, index) => (
          <div key={index} className="flex justify-center items-center">
            <img src={logo} alt={`Logo ${index + 1}`} className="h-16 md:h-24 lg:h-32 object-contain" />
          </div>
        ))}
      </div>
    </div>
  );

};

export default Logosbar;
